path = [[1,1],[3,1],[5,1],[7,1],[1,2]]
def calc_trees(lst, path):
    lst_o_lst = [list(x) for x in lst]
    prod = 1
    for p in path:
        tmp = 0
        lst_cp = lst_o_lst.copy()
        x_incr = 0
        for i in range(0,len(lst_cp)-p[1],p[1]):
            x_incr = x_incr + p[0]
            while(x_incr >= len(lst_cp[i+p[1]])):
                lst_cp[i] = lst_cp[i]+lst_cp[i]
                lst_cp[i+p[1]] = lst_cp[i+p[1]] + lst_cp[i+p[1]]
            if(lst_cp[i+p[1]][x_incr] == "#"):
                tmp = tmp + 1
        prod = prod*tmp
    return prod
calc_trees(lst, path)
